import { Text, Image, Button } from "native-base";
import CustomInput from "./CustomInput";
export default function Login() {
  return (
    <>

      <Image
      source={require("../assets/logo.png")}
        alt="Alternate Text"
        size="xl"
      />

    <CustomInput text="Username" />
    <CustomInput text="Password" />
    <Button flex={1} alignItems="center" justifyContent="center" margin={10}>Click me</Button>



    </>
  );
}
